import ava03 from '../../assets/images/ava-3.jpg'


const Testimonials = () => {
    return (
        <Slider>
            <div className="testimonial py-4 px-3">
                <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Itaque quaerat 
                    reprehenderit quis, voluptas ex blanditiis quisquam dolore necessitatibus
                     minus hic. Dicta atque ullam porro quas nostrum veniam, molestias deleniti
                      modi.</p>
                <div className='d-flex alig-items-center gap-4 mt-3'>
                    <img src={ava01} alt='' className='w-25 h-25 rounded-2'/>
                    <h5>John D</h5>
                </div>
            </div>
        </Slider>
    )
};

export default Testimonials;
